if __name__ == "__main__":
    import csv
    import os.path
    import pprint
    import urllib2

    IANA_FILE = "service-names-port-numbers.csv"
    IANA_URL  = "http://www.iana.org/assignments/service-names-port-numbers/"

    tcp_port_to_service = {}
    tcp_service_to_port = {}
    udp_port_to_service = {}
    udp_service_to_port = {}

    if not os.path.exists(IANA_FILE):
        data = urllib2.urlopen(IANA_URL + IANA_FILE).read()
        with open(IANA_FILE, "wb") as f:
            f.write(data)
        data = ""

    with open(IANA_FILE, "rU") as f:

        # Service Name, Port Number, Transport Protocol, Description,
        # Assignee, Contact, Registration Date, Modification Date, Reference,
        # Service Code, Known Unauthorized Uses, Assignment Notes

        reader = csv.reader(f)
        for row in reader:
            if not row:
                continue

            service = row[0].lower()
            if not service:
                continue

            try:
                port = int(row[1])
            except ValueError:
                continue
            if not port:
                continue

            proto = row[2].lower()
            if proto == "tcp":
                port_to_service = tcp_port_to_service
                service_to_port = tcp_service_to_port
            elif proto == "udp":
                port_to_service = udp_port_to_service
                service_to_port = udp_service_to_port
            else:
                continue

            port_to_service[port] = service
            service_to_port[service] = port

        reader = None

    port_to_service = {}
    service_to_port = {}

    services = set(tcp_service_to_port.iterkeys())
    services.intersection_update(udp_service_to_port.iterkeys())
    for service in services:
        port = tcp_service_to_port[service]
        port_to_service[port] = service
        service_to_port[service] = port
    services.clear()

    source = "tcp_port_to_service = \\\n%s\n" \
             "tcp_service_to_port = \\\n%s\n" \
             "udp_port_to_service = \\\n%s\n" \
             "udp_service_to_port = \\\n%s\n" \
             "port_to_service = \\\n%s\n" \
             "service_to_port = \\\n%s\n"
    source %= (pprint.pformat(tcp_port_to_service, indent=1),
               pprint.pformat(tcp_service_to_port, indent=1),
               pprint.pformat(udp_port_to_service, indent=1),
               pprint.pformat(udp_service_to_port, indent=1),
               pprint.pformat(port_to_service,     indent=1),
               pprint.pformat(service_to_port,     indent=1))

    separator = "#" * 3
    separator = separator + " DO NOT EDIT THIS LINE " + separator + "\n"
    with open(__file__, "rU") as f:
        data = f.read()
    p = data.find(separator)
    if p >= 0:
        p += len(separator)
        q = data.find(separator, p)
        if q >= p:
            data = data[:p] + source + data[q:]
            with open(__file__, "w") as f:
                f.write(data)
        else:
            raise RuntimeError("Separator not found! Did you edit the file?")
    else:
        raise RuntimeError("Separator not found! Did you edit the file?")
